    "2015-08-14T06:38:30.060811",nt"name": "online-ftz-information-system-ofis",nt"isopen":
    true,nt"url": null,nt"notes": "Provides comprehensive information on each
    foreign-trade zone (contact information, sites, subzones, approvals and actions)
    to the public on the web.  Individual FTZs and companies are able to log in to the
    system to update their contact information and status.rnAlso provides a web-based
    system for FTZs to submit their required annual report to the FTZ Board (previously
    this had been a paper process).rnThis system also incorporates a prior database
    of Federal Register notices describing proposed FTZ locations and activity along
    with the ultimate FTZ Board decision on each case.  Recent notices also include
    the full text of applications and any public comments received.  The consolidation
    of this database into OFIS makes all information on a specific zone available in
    one location on our website.",nt"license_title": "U.S. Government Work",nt"extras":
